import { useState } from "react";

function Header() {
    const [date, setDate] = useState(new Date())
    const [showCart, setShowCart] = useState(true)

    setTimeout(() => {
        setDate(new Date())
    }, 1000);

    return <div className="header">
        <div className="">
          <p>{date.getFullYear()} - {date.getMonth()} - {date.getDay()}</p>
          <p>{date.getHours()} : {date.getMinutes()} : {date.getSeconds()}</p>
        </div>
        <div className="">Your Cart 0</div>


        <div className="header-back">background</div>
        <div className="header-front" onClick={setShowCart(false)}>front</div>
    </div>
}

export default Header
